import io from "socket.io-client";

const endpoint = "http://localhost:3005/";
const socket = io(endpoint);

function Connect() {
  useEffect(() => {
    socket.on("three", data => {
      console.log("hit " + data);
    });
    return () => {
      socket.on();
    };
  }, []);
}
